        let x = props.game.round[0].player_positions[85].position_point[0].position.x;
        let y = props.game.round[0].player_positions[85].position_point[0].position.x;
    }

    render(){
        return(
            <Container>
                <Image src="/maps/mirage.png" rounded>
                    <p>ell</p>
                </Image>
            </Container>
        );
    }
}

class Game extends React.Component{
    constructor(props){
        super();
    }

    render(){
        return(
            <Jumbotron>
                <PlaybackArea game={this.props.game}/>
            </Jumbotron>
        );
    }
}

function WatchPage(props){
    return(
        <Container>
            <Game game={props.game}/>
        </Container>
    )
}

export default WatchPage;
